import React from 'react';
import PropTypes from 'prop-types';
import { Rating, Header, Message, Divider, Segment } from 'semantic-ui-react';

const About = ({
  doctor: {
    name,
    formatted_phone_number,
    formatted_address,
    rating,
    url,
    website,
  },
  rate,
  favorite,
}) => (
  <Segment textAlign='center'>
    <Header
      as='a'
      href={website}
      rel='noopener noreferrer'
      target='_blank'
      content={name}
    />

    <Rating
      onRate={(e, data) => rate(e, data)}
      icon='heart'
      rating={favorite}
      maxRating={1}
      size='massive'
    />
    <Divider hidden />
    <Message as='a'>
      <a rel='noopener noreferrer' href={`tel:${formatted_phone_number}`}>
        {formatted_phone_number}
      </a>
    </Message>
    <Message>
      <a href={url} rel='noopener no referrer' target='_blank'>
        {formatted_address}
      </a>
    </Message>

    {rating && (
      <Message content='Average Rating: '>
        {<Rating disabled size='massive' icon='star' maxRating={5} rating={rating} />}
      </Message>
    )}
  </Segment>
);

About.propTypes = {
  doctor: PropTypes.object.isRequired,
  rate: PropTypes.func.isRequired,
};

export default About;
